export const GetCities = (ids: string[]): (City | undefined)[] => {
  return ids.map(c => GetCity(c));
}

export const GetCity = (id: string): City | undefined => {
  return Cities.find(c => c.id.toLowerCase() == id.toLowerCase());
}

export class City {
  name!: string;
  country!: string;
  iso3!: string;
  population!: number;
  id!: string;
}

